"""
Given two strings s and t which consist of only lowercase letters.
Strings t is generated by random shuffling string s and then add one more letter at a random position.
Find the letter that was added in t.
Input:
s = "abcd"
t = "abcde"
Output: e
Explanation: 'e' is the letter that was added.
"""
from time import sleep

class Solution:
    def findTheDifference(self, firstString, secondString):
        _first = set(firstString)
        _second = set(secondString)
        fCount = sCount = 0
        for char in _first:
            while fCount < len(_first) and sCount < len(_second):
                if firstString.count(char) != secondString.count(char):
                    return char
                else:
                    fCount += 1
                    sCount += 1
                    break
        return secondString[sCount]

if __name__ == '__main__':
    s = Solution()
    # firstString = 'abcd'
    # secondString = 'abcde'
    # print(s.findTheDifference(firstString, secondString))
    firstString = ""
    secondString = ""
    print(s.findTheDifference(firstString, secondString))
